import React from "react";
import './style.scss';
import {AcessaBR} from '../../images/AcessaBR.svg';
import {logoebac} from '../../images/logoebac.svg';

export const Header = () => {
    return(
        <header className="header__container">            
            <div className="header__logo--state">
            <span>
               / Sorocaba, SP
            </span>                  
               <img src="{AcessaBR}" alt="logo AcessaBR"/>
            </div>
            <div className="header__logo--ebac">
                <span>
                    Apoio:
                </span>
               <img src="{logoebac}" alt="logo Ebac"/>                 
            </div>
        </header>
    )
}
export default AcessaBR.svg;
